Page:
  Page_1:
    owner_id: sfGuardUserProfile_5
    title: 'Vincent van Gogh'
    description: 'Vincent Willem van Gogh Vincent Willem Van Gogh (Zundert, Ipar Brabant, 1853ko martxoaren 30a - Auvers-sur-Oise, Val-d`Oise, 1890eko uztailaren 29a) herbeheretar margolari postinpresionista ospetsua izan zen. Marrazkirako dohaina txiki-txikitandik erakutsi bazuen ere, Van Gogh ez zen hogeita zazpi urte bete arte hasi marrazten eta pintatzen, eta hamar urte besterik ez zituen egin artegintzan. Bizitza eta artegintza hain daude lotuak Van Goghengan, non bizilekuz aldatu zuen aldi bakoitzari aro berri bat baitagokio bere lanean. Parisko egonaldia bukatu, eta Arles-en bizi izan zenean iritsi zuen betetasuna Van Goghen arteak: bi urtean, 350 bat margolan egin zituen. Hala, pinturaren historiako artistarik handienetako bat izatera iritsi zen. Haren sentimenduen, usteen eta gogoeten berri zehatza ematen dute bere anaia gazte Theori hemezortzi urtez idatzi zizkion gutunek. Gutun horiek, bere barnean zeukan gaixotasunarekin izandako borroka lazgarriaren lekuko izateaz gainera, literatura-maila handiko adierazpen dira.'
    photo: 7abf03ea277aaf1f5f29e87bcf1667bda9ca35f0.jpg
    updated_at: '2012-01-01 01:01:01'
  Page_2:
    owner_id: sfGuardUserProfile_5
    title: 'Francisco Goya'
    description: 'Francisco José de Goya y Lucientes (Fuendetodos, Zaragoza, 1746ko martxoaren 30a - Bordele, Frantzia, 1828ko apirilaren 16a) pintore eta grabatzaile espainiarra izan zen, erromantizismoaren garaikoa eta euskal jatorrikoa. Bere aita margolaria eta erretaulen urreztatzailea zen, eta bere ama, Aragoiko noblezia txikitik zetorren.  14 urtekin, Escuela de Pías de Zaragoza delakoan sartu zen eta ikasle hasi zen lanean José Luzánen lantegian. 1763an, Madrilera bidaiatu zuen, Academia de Bellas Artes de San Fernandotik beka bat eskuratzeko esperantzarekin, baina laguntza hori ez zitzaion iritsi, ezta ere, 1766an, berriro saiatu zenean. Madrilen, Francisco Boyeu ezagutu zuen eta lagunak egin ziren, eta honek eta Velazquezen lanak, Goyaren formazio goiztiarrean influentzia handia eduki zuen.  Fernando VII erregearen erregetza absolutistarengatik 1824an Frantziara joan zen, eta Bordelen jarraitu zuen lanean. Goyak ez zuen oinordeko artistikorik utzi.  Goyak Edouard Manet, Pablo Picasso eta pintura garaikideko zati handi batean izan zuen eragina.'
    photo: ebb7cfdedbfd4ce8580f7e14782814bebd501831.jpg
    updated_at: '2012-01-01 01:01:01'
  Page_3:
    owner_id: sfGuardUserProfile_5
    title: 'Paul Cézanne'
    description: 'Paul Cézanne (pɔl se`zan; Aix-en-Provence, 1839ko urtarrilaren 19a - Aix-en-Provence, 1906ko urriaren 22a) frantziar margolaria izan zen, inpresionismotik kubismorako trantsizioko eragile nagusietako bat.  Garaiko artista guztien artean, Cézanne izan daiteke XX. mendeko artistengan eragin handienetakoa izan zuena (Henri Matissek, adibidez, Cézanne-ren kolorearen erabilera goresten zuen, eta Pablo Picassok haren konposizio lauaren egitura garatu zuen kubismoa sortzeko). Hala ere, itzalean bizi izan Cézanne, eta bakandurik lan egin. Ez zuen kritikariengan konfiantzarik, lagun urri zituen, eta 1895 arte oso gutxitan erakutsi zituen margolanak. Familiatik ere aldenduta bizi izan zen, familiakoek ez baitzuten aintzat hartzen sortutako arte iraultzaile hori.'
    photo: 3cf30904a07770a7a2f2096294967fc753e64994.jpg
    updated_at: '2012-01-01 01:01:01'
  Page_4:
    owner_id: sfGuardUserProfile_9
    title: 'Wolfgang Amadeus Mozart'
    description: 'Wolfgang Amadeus Mozart (Salzburg, 1756ko urtarrilaren 27a-Viena, 1791ko abenduaren 5a) aro klasikoko austriar konpositore handi eta emankorra izan zen. 600 obra baino gehiago konposatu zituen; haietako asko, musikagintzaren gailurtzat aitortuak hainbat arlotan: opera, musika sakratua, ganbera-musika, orkestrarakoa, (sinfoniak eta abar. Konpositore klasikoen artean ezagunenetarikoa da.'
    photo: 37ec538b5c57608880909afbcdbcf88ac6edf422.jpg
    updated_at: '2012-01-01 01:01:01'
